    student assistant at Malheur Refuge during the summer of 1954.  The purpose of the
    report is to acquaint the reader with the activities and accomplishments of the
    student assistant during this period.  Biological work such as goose nest-searching,
    preparations for the transfer of trumpeter swans, and some common labor occupied
    the first part of the summer.  Phytocidal work and dove banding were conducted during
